public void DisplayOracleReport(string reportId, NameValueCollection parameters)\n{\n    string baseUrl = "http://your-oracle-report-server/reports/rwservlet?";\n    string reportUrl = $"{baseUrl}report=reports/{reportId}.rep";\n\n    // Append parameters to the URL if needed\n    if (parameters != null && parameters.Count > 0)\n    {\n        foreach (string key in parameters.Keys)\n        {\n            reportUrl += $"&{key}={HttpUtility.UrlEncode(parameters[key])}";\n        }\n    }\n\n    // Assuming you're setting an iframe with ID "ReportFrame" to display the report\n    ReportFrame.Attributes["src"] = reportUrl;\n}